import webbrowser, leew, os

def imprimir(id_trab):
    # Imprime el carnet de los trabajadores
    # OBTENER VALORES

    f = open(f'C:\\Users\\{os.environ.get("USERNAME")}\\datosSNPdo\\carnets\\carnet' + str(id_trab) + '.svg', 'w', encoding='utf-8')
    nombre = leew.consulta_gen('worker.db','Nombre','info','id',str(id_trab))
    apellido = leew.consulta_gen('worker.db','Apellido','info','id',str(id_trab))
    nom_apell = nombre + ' ' + apellido
    cedula = leew.consulta_gen('worker.db','Identificacion','info','id',str(id_trab))
    foto = leew.consulta_gen('worker.db','foto_en_trab','info','id',str(id_trab))
    foto_slash_inv = foto.replace("/","\\")
    absref = f'C:\\Users\\{os.environ.get("USERNAME")}\\datosSNPdo\\' + foto_slash_inv


    #datos de la empresa

    nombre_empresa = leew.consulta_gen('worker.db','nombre_sociedad','info_sociedad','estatus','"Vigente"')
    #print(len(nombre_empresa))
    if len(nombre_empresa) > 23: # es un factor de correccion
        tam_letra = 0.5
    elif len(nombre_empresa) > 15 and len(nombre_empresa) < 24:
        tam_letra = 0.75
    elif len(nombre_empresa) < 16:
        tam_letra = 1

    ciudad = leew.consulta_gen('worker.db','ciudad','info_sociedad','estatus','"Vigente"')
    estado = leew.consulta_gen('worker.db','estado','info_sociedad','estatus','"Vigente"')
    direccion = f'{ciudad}, {estado}'
    rnc = str(leew.consulta_gen('worker.db','rnc','info_sociedad','estatus','"Vigente"'))
    telf = str(leew.consulta_gen('worker.db','tel_fijo','info_sociedad','estatus','"Vigente"'))
    pag_web = leew.consulta_gen('worker.db','pag_web','info_sociedad','estatus','"Vigente"')
    email = leew.consulta_gen('worker.db','email','info_sociedad','estatus','"Vigente"')
    ruta_logo = leew.consulta_gen('worker.db','ruta_logo','info_sociedad','estatus','"Vigente"')
    if ruta_logo == None:
        ruta_logo = ''
    ruta_logo = ruta_logo.replace("/","\\")
    ruta_logo = f'C:\\Users\\{os.environ.get("USERNAME")}\\datosSNPdo\\' + ruta_logo

